export default function Sidebar() {
    return (
        <>
            <ul>
                <li><a>Title of News Article</a>CNN</li>
                <li><a>Title of News Article</a>TechCrunch</li>
                <li><a>Title of News Article</a>Medium.com</li>
                <li><a>Title of News Article</a>Businessinsider.com</li>
            </ul>
            <style jsx>{`
                ul {
                    position: relative;
                    margin-block-start: 0;
                    margin-block-end: 0;
                    list-style-type: none;
                    width: 200px;
                    height: calc(100% - 55px);
                    padding: 0px;
                    background-color: #e4e4e4;
                }

                li a {
                    display: block;
                    padding: 8px 8px;
                    color: #000;
                }

                li {
                    padding: 10px;
                    border-bottom-style: solid;
                }
            `}</style>
        </>
    );
}
